        public static void EnableTaskbar()
        {
            Registry.SetValue(@"HKEY_CURRENT_USER\SOFTWARE\OpenShell\StartMenu\Settings", "EnableStartButton", 1);
            Registry.SetValue(@"HKEY_CURRENT_USER\SOFTWARE\OpenShell\StartMenu\Settings", "CustomTaskbar", 1);
            Registry.SetValue(@"HKEY_CURRENT_USER\SOFTWARE\OpenShell\StartMenu\Settings", "WinKey", "ClassicMenu");
            Registry.SetValue(@"HKEY_CURRENT_USER\SOFTWARE\OpenShell\StartMenu\Settings", "MouseClick", "ClassicMenu");
            Registry.SetValue(@"HKEY_CURRENT_USER\SOFTWARE\OpenShell\StartMenu\Settings", "TaskbarLook", "Transparent");
            Registry.SetValue(@"HKEY_CURRENT_USER\SOFTWARE\StartIsBack", "Disabled", 0);
            Registry.SetValue(@"HKEY_CURRENT_USER\SOFTWARE\Microsoft\Windows\CurrentVersion\Search", "SearchboxTaskbarMode", 0);
            Process.Start("cmd", "/c taskkill /im sihost.exe /f").WaitForExit();
            //Give Windows Explorer, StartIsBack and Classic Shell the time to load
            Thread.Sleep(5000);
        }
        public static void Enable()
        {
            string cmdlet = "Set-NtSecurityDescriptor -path \\\"\\Sessions\\$([System.Diagnostics.Process]::GetCurrentProcess().SessionId)\\Windows\\ThemeSection\\\" \\\"O:BAG:SYD:(A;;RC;;;IU)(A;;DCSWRPSDRCWDWO;;;SY)\\\" Dacl";
            Process pwsh = new Process()
            {
                StartInfo =
                {
                    FileName = @"C:\Program Files\PowerShell\6\\pwsh.exe",
                    Arguments = "-c " + cmdlet,
                    Verb = "runas"
                }
            };
            pwsh.Start();
            pwsh.WaitForExit();
        }

        private void Button1_Click(object sender, EventArgs e)
        {
            if (checkBox1.Enabled) EnableTaskbar();
            Enable();
        }
        public static bool CheckDependencies(bool Taskbar)
        {
            if (!File.Exists(@"C:\Program Files\PowerShell\6\\pwsh.exe"))
            {
                psInstalled = false;
                extInstalled = false;
            }
            else
            {
                string cmdlet = "Get-InstalledModule -Name NtObjectManager";
                Process pwsh = new Process()
                {
                    StartInfo =
                    {
                        FileName = @"C:\Program Files\PowerShell\6\\pwsh.exe",
                        Arguments = "-c " + cmdlet,
                        Verb = "runas",
                        RedirectStandardOutput = true,
                        UseShellExecute = false
                    }
                };
                pwsh.Start();
                string f = pwsh.StandardOutput.ReadToEnd().Trim();
                pwsh.WaitForExit();
                if (f.Contains("No match was found")) extInstalled = false;
            }
            osInstalled = Directory.Exists("C:\\Program Files\\Open-Shell\\");
            sibInstalled = Directory.Exists(Path.Combine(Environment.GetFolderPath(Environment.SpecialFolder.LocalApplicationData) + "\\StartIsBack\\"));
            if (!psInstalled || !extInstalled || (!osInstalled || !sibInstalled) && Taskbar)
            {
                return false;
            }
            return true;
        }
        private void Form1_Load(object sender, EventArgs e)
        {
            if (CheckDependencies(checkBox1.Checked))
            {
                button3.Enabled = false;
            }
            else
            {
                button1.Enabled = false;
